import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="header_back">
        <div className="logo">House of Light</div>
        <ul className="nav_list">
          <li className="nav_item">
            <a href="">Par mums</a>
          </li>
          <li className="nav_item">
            <a href="">Ēdienkarte</a>
          </li>
          <li className="nav_item">
            <a href="">Brančs</a>
          </li>
          <li className="nav_item">
            <a href="">Keiterings</a>
          </li>
          <li className="nav_item">
            <a href="">Kontakti</a>
          </li>
        </ul>
        <div className="nav_burger"></div>
      </div>
    </div>
  );
};

export default Header;
